#include <iostream>
using namespace std;

bool checkArr(int arr[26]){
  for(int i=0; i<26; i++){
    if(arr[i] == 2){
      return true;
    }
  }
  return false;
}

void removeDup(string& s){
  int i = 0;
  while((i < s.length() - 1) && (s.length()>0)){

    int arr[26] = {0};

    int index1 = s[i] - 'a';
    int index2 = s[i+1] - 'a';
    arr[index1]++;
    arr[index2]++;

    if(checkArr(arr)){
      s.erase(i,2);
      if(i>0){
        i=i-1;
      }
      else{
        i=0;
      }
    }
    else{
      i++;
    }
  }

  return;
}

int main(){
  string s = "";

  removeDup(s);

  cout << s << endl;
}